import './Landtex.css';

const Landtex = () => {
    return ( <div className = "heada">
            <div className="title">
                <h1>We are problem solvers</h1>
            </div>
            <div className ="texbod">
                <p>We are Atlassian Products Migration Lab. We produce Tools, Systems and Services that deliver complete data migration in half the time for half the cost.</p>
            </div>

            <div className='but'>
                <p>See Our Products</p>
            </div>
    </div> );
}
 
export default Landtex;
